    false,nt"url": null,nt"notes": "This Water Resource Inventory and Assessment
    report for Quivira NWR describes current hydrologic information, provides an assessment
    of water resource needs and issues of concern, and makes recommendations regarding
    Refuge water resources.  The Water Resource Inventory and Assessment evaluates water
    quality and quantity issues, water rights, water management, potential threats to
    water supplies, hydroclimate trends, and other water resource issues for the Refuge.
